clear

set(groot,'defaulttextinterpreter','latex');  
set(groot, 'defaultAxesTickLabelInterpreter','latex');  
set(groot, 'defaultLegendInterpreter','latex');

% Spring constants
syms K_t K_e 

% Distances
syms b_2 L_1 L_2 u_in
% body_2 Length_1 length_2
syms u_in0

% Angles
syms theta_1 theta_2
syms theta_10 theta_20

% Spring properties
syms E_t E_e I_t I_e l_t l_e

% Input force
syms F_in

% Calculate effective lengths and spring constants
L_2 = b_2 + l_t;
K_t = E_t * I_t / l_t;

% Linear spring has no change in effective length as it is mounted slightly
% offcenter due to needing to be attached to a body.

eq1 = u_in == 2*L_2*(1-cos(theta_2)) %[output:25ef04d4]
theta_2_sol = solve(eq1, theta_2);
theta_2_sol = theta_2_sol(1) %[output:07d0f559]

d_theta_2 = diff(theta_2_sol, u_in) %[output:619fa052]

% Introduce Lagrange coordinates
phi_2 = theta_2_sol-theta_20 %[output:66fca774]
phi_3 = L_2*(sin(theta_2_sol)-sin(theta_20)) %[output:675bb4a7]

dphi_2 = diff(phi_2, u_in) %[output:672c3699]
dphi_3 = diff(phi_3, u_in) %[output:6450084d]

T_t = -4*K_t*phi_2 %[output:91517bad]
T_e = -K_e*phi_3 %[output:45f1197d]

eq2 = F_in + T_t*dphi_2 + T_e*dphi_3 %[output:8ef6205c]

F_in_sol = solve(eq2, F_in) %[output:3193d3be]


% Flexure elements properties
E_flexure = 179e9;
b = 10e-3;
h = 0.4e-3;
I_value = b * h^3 / 12;

% Parameter dictionary
theta_0 = deg2rad(3);
p_vars = [theta_20, l_t,   I_t,     E_t,       b_2,  K_e];
p_vals = [theta_0,  10e-3, I_value, E_flexure, 0.1];
p_vals0 = [p_vals, 0];
p_vals1 = [p_vals, 1000];

u_in0 = double(solve(subs(eq1,[p_vars, theta_2],[p_vals0,theta_0]),u_in));


F_in_sol_no_spring = subs(F_in_sol, p_vars, p_vals0);
F_in_sol_spring = subs(F_in_sol, p_vars, p_vals1);
theta_2_sol = subs(theta_2_sol, p_vars, p_vals0);

xmax = 0.2;
xmin = -0.02;
figure(1), clf; %[output:824c11d9]
tiledlayout(2,1) %[output:824c11d9]
nexttile; %[output:824c11d9]
hold on; %[output:824c11d9]
grid on; %[output:824c11d9]
fplot(F_in_sol_no_spring, [u_in0, xmax]) %[output:824c11d9]
fplot(F_in_sol_spring, [u_in0, xmax]) %[output:824c11d9]
ylim([0, 75]) %[output:824c11d9]
xlim([xmin,xmax]) %[output:824c11d9]
ylabel("$F$ Force") %[output:824c11d9]
nexttile; %[output:824c11d9]
hold on; %[output:824c11d9]
grid on; %[output:824c11d9]
fplot(theta_2_sol, [xmin, xmax]) %[output:824c11d9]
xlim([xmin,xmax]) %[output:824c11d9]
xlabel("$U$ displacement") %[output:824c11d9]
ylabel("$\theta$ displacement") %[output:824c11d9]




